import { Component, OnInit } from '@angular/core';
import { UsuarioServices } from './services/usuario.services';
import { Usuario } from './models/usuario';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  providers: [UsuarioServices]
})

export class AppComponent implements OnInit {
  public title = 'DistributionSystem';
  public usuario: Usuario;
  // public persona: Persona;
  public identity = false; // Datos del usuario identificado ahi dentro. Guardado en localStorage
  public token = null;

  constructor(
    private _usuarioServices: UsuarioServices
  ){
    this.usuario = new Usuario('','','','','','ROLE_USER','', new Date, new Date);  
    // this.persona = new Persona('','','','','','','');  
  }

  ngOnInit(){

  }

  public onSubmit(){
    console.log(this.usuario);

    this._usuarioServices.signUp( this.usuario ).subscribe(
      response => {
        console.log( response );
      },
      error => {
        var errorMensaje = <any>error;

        if( errorMensaje != null){
          console.log(error);
        }
      }
    );    
  }

}
